import React from 'react'

function PassData(props) {
    const {brand,model,color,year} = this.state.props;
  return (
    <div>
        <h1>Brand: {this.statebrand}</h1>
        <h1>Model: {model}</h1>
        <h1>Color: {color}</h1>
        <h1>Year: {year}</h1>
    </div>
  )
}

export default PassData;
